import React from 'react';
import {Navbar, NavbarBrand} from 'reactstrap';
import Menu  from './components/MenuComponent';
import './App.css';

function App() {
  return (
    <div >
      <Navbar dark color= "primary">
        <div>
          <NavbarBrand href="/">Ristorante Con Fusion</NavbarBrand>
        </div>
      </Navbar>
       <Menu />
    </div>
  );
}

export default App;
